import { Keyboard, StyleSheet, TouchableWithoutFeedback } from 'react-native';

import EditScreenInfo from '../components/EditScreenInfo';
import { Text, View } from '../components/Themed';
import { RootTabScreenProps } from '../types';

import { Button, Divider, Flex, TextInput, Pressable } from "@react-native-material/core";

export default function Login() {
  return (
    <TouchableWithoutFeedback onPress={() => Keyboard.dismiss()}>
      <View style={styles.container}>
        <TextInput label='Email' style={styles.input} variant='outlined' color='#4ABBC1'/>
        <TextInput label='Password' style={styles.input} variant='outlined' color='#4ABBC1'/>
        <Flex style={styles.newAccountContainer}>
          <Text>Need an account?</Text>
          <Pressable><Text>Sign up here</Text></Pressable>
        </Flex>
      </View>
    </TouchableWithoutFeedback>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    // alignItems: 'center',
    justifyContent: 'center',
    padding: 45
  },
  input: {
    marginBottom: 20
  },
  newAccountContainer: {
    flexDirection: 'row'
  }
});
